import * as t from "react";
import r from "../lib/SSRBase.es.js";
import m from "../defs/Path.es.js";
const o = t.forwardRef((a, e) => /* @__PURE__ */ t.createElement(r, { ref: e, ...a, weights: m }));
o.displayName = "PathIcon";
const f = o;
export {
  f as Path,
  o as PathIcon
};
